import BootstrapTable from 'react-bootstrap-table-next';
import useSWR from "swr/dist/index";
import { Spinner } from "react-bootstrap";
import React from 'react';


function add_column(columns, dataField, text, sort){
  columns.push({
    dataField: dataField,
    text: text,
    sort: sort
  })
}

function Table({dataUrl, columnTitles}) {
  const { data, error } = useSWR(dataUrl);
  if (error) return <h1>Something went wrong!</h1>;
  if (!data) return <Spinner animation="border" variant="primary" size="mg"/>;
  const tableData = data.number_of_firmware_by_android_version;

  let columns = [];
  columnTitles.forEach(element => add_column(columns, element, element, true));

  return <BootstrapTable data={ tableData }
                         columns={ columns }
                         striped
                         hover
                         condensed/>
}




export default Table;
